import React from 'react';
import './App.css';
import Nav from './components/Nav';
import Header from './components/Header';
import BookingForm from './components/BookingForm';
function App() {
  return (
    <>
      <Nav/>
      <Header/>
      <BookingForm/>
    </>

  );
}

export default App;
